**TypeScript Version:**  latest

```js
/** @typedef {{ email: string, nickName?: string }} U2 */

/** @type {U2} */
const u2 = { email: "" }
```

**Actual behavior:**
`U2` in `/** @type {U2} */` is marked deprecated.

While I dislike `@typedef` as much as the next programmer, we shouldn't mark every alias created with it as deprecated.

When formatting 
```rust
#![feature(const_generics)]

fn foo<
    const N: [u8; {
        struct Inner<'a>(&'a ());
        3
    }],
>() {}
```
rustfmt changes the empty function argument list from `()` to  `(&'a ()`, which is incorrect.
```rust
#![feature(const_generics)]

fn foo<
    const N: [u8; {
        struct Inner<'a>(&'a ());
        3
    }],
>(&'a () {
}

```
Note that the original code snippet current does not yet compile due to the unfinished nature of const generics,
it should compile in the future though.

This example changes its verification status when the `#if 0` is toggled:
```c
int foo()
    /*@ requires true; @*/
    /*@ ensures  result == 3*42; @*/
    /*@ terminates; @*/
{
    int x = 0;
    int i,j,k;

    for(i = 0; i < 6; ++i)
        /*@ requires i >= 0 &*& i <= 6 &*& x + 3*7*(6-i) < 100000; @*/
        /*@ ensures  old_x + (6-old_i)*7*3 == x; @*/
        /*@ decreases 6-i; @*/
    {
        for(j = 0; j < 7; ++j)
            /*@ requires j >= 0 &*& j <= 7 &*& x + 3*(7-j) < 100000; @*/
            /*@ ensures  old_x + (7-old_j)*3 == x; @*/
            /*@ decreases 7-j; @*/
        {
#if 0
            x += 3;
#else
            for(k = 0; k < 3; ++k)
                /*@ requires k >= 0 &*& k <= 3 &*& x + (3-k) < 100000; @*/
                /*@ ensures  old_x + (3-old_k) == x; @*/
                /*@ decreases 3-k; @*/
            {
                ++x;
                /*@ recursive_call(); @*/
            }
#endif
            /*@ recursive_call(); @*/
            /*@ {
                assert old_x + 3 + (7-(old_j+1))*3 == x; 
                assert old_x + (7-old_j)*3 == x; 
            } @*/
        }
        /*@ recursive_call(); @*/
    }
    return x;
}
```
With only 2 nested loops it seems to behave correctly.

While working with the LuceneSail in our application, we found an issue in the re-indexing routine: with the current logic the last document is not persisted in the index.

Unit test for reproducing this (part of AbstractLuceneSailTest)

```
@Test
	public void testReindexing_SingleResource() throws Exception {

		// wipe the Lucene index to allow specific test data
		try (RepositoryConnection connection = repository.getConnection()) {
			connection.clear();
		}

		String query = "PREFIX search: <http://www.openrdf.org/contrib/lucenesail#> \n" +
				"SELECT ?subj ?text ?prop ?score WHERE { \n" +
				"  ?subj search:matches [ search:query \"one\" ; search:property ?prop; search:snippet ?text ; search:score ?score] }";

		List<BindingSet> res;

		// expected empty result => no data in the index
		res = Repositories.tupleQuery(repository, query, t -> Iterations.asList(t));
		Assert.assertEquals(Collections.emptyList(), res);

		try (RepositoryConnection connection = repository.getConnection()) {
			connection.add(SUBJECT_1, PREDICATE_1, vf.createLiteral("one"));
		}

		// expected single result
		res = Repositories.tupleQuery(repository, query, t -> Iterations.asList(t));
		Assert.assertEquals(1, res.size());

		// re-index
		this.sail.reindex();

		// expected single result
		res = Repositories.tupleQuery(repository, query, t -> Iterations.asList(t));
		Assert.assertEquals(1, res.size());
	}
```

