\xf0\x9f\x91\x8b! I gave a first pass to the code and I'm happy! I can easily read it follow what's going on in the app.

I noticed that most of the logic lives inside the `Index` component. While this works, it makes hard to eventually reuse some of that logic in other, possible future, parts of the application. I think the code can be split based on its purpose. Here's a (vague) list of categories you can use

- **UI code**: the code that renders the interface.
- **state code**: the code that holds and handles the data for the UI.
- **retrieval code**: the code that brings the data from some external entity and makes it consumable for the app. On web this is usually code that calls an API, but it can also obtain the data from `localStorage` or cookies.
- **piping code**: code that puts everything together (i.e. calls retrieval code and gives the result to the state code).

Using these categories helps to decide what code should live in an independent module and what should be closer.

For example, [this block](https://github.com/afgomez/news-feed/blob/master/frontend/src/pages/Index.tsx#L56-L122) is mostly network code. I think it can be extracted into its own function and then call that function from within `Index`.

```tsx
// api/news.ts
export async function fetchNews(searchTerm, aggregations): Promise<{ ... }> {
  return fetch(
    `${process.env.REACT_APP_ELASTIC_SERVICE_URL}/search?search=${search}`,
    {
      method: 'POST',
      body: JSON.stringify({ aggs: selectedAggs }),
      headers: {
        'Content-type': 'application/json',
      },
    }
  ).then(() => {
    /*
     * Transform ES response into something the app can use
     * maybe something like.
     * {
     *   news: {
     *     items: [...],
     *     categories: [...],
     *     dates: [...],
     *     ...
     *   }
     * }
     */
  });
}
```
```tsx
// pages/Index.tsx
import { fetchNews } from '../api/news';

function Index() {
  // ...

  const onSuggestionSelected = (search: string): void => {
    setSearchValue(search);
    fetchNews(search, selectedAggs).then(({ news, videos, ...}) => {
      /* Pipe the data onto the state */
    })
  }

  // ...
}
```

That way is easier to potentially reuse the `fetchNews` in different parts, or make other refactorings possible. Imagine you want to fetch only the news, or only the videos. You could easily add a third optional parameter to do so, whereas with the current code it will be harder to do so (IMO).

I noticed some type casts in parts of the code.

```tsx
const [news, setNews] = useState([] as ESNews[]);
const [newsAgg, setNewsAgg] = useState({} as ESAggregations);
const [videos, setVideos] = useState([] as ESVideo[]);
...
```

If the compiler cannot infer the right types (like in this case), in general it's better to use [generics](https://www.typescriptlang.org/docs/handbook/generics.html).

```tsx
const [news, setNews] = useState<ESNews[]>([]);
const [newsAgg, setNewsAgg] = useState<ESAggregations>({});
const [videos, setVideos] = useState<ESVideo[]>([]);
...
```

The difference is subtle, but important. The annotation in the first case tells the compiler that a certain piece of data is of a certain type, **and it blindly believes you even if it isn't.** The second block tells the compiler what the data is, and it warns you if it isn't.

You can see it in [this playground](https://www.typescriptlang.org/play/#code/KYDwDg9gTgLgBASwHY2FAZgQwMbDgFWAGd4BvAKDjnQWABsATALjhKmQHMBucgX3PLoArkmwwEEJHA7AYAMVqMAFBABGAKxaESAShZtOcClSiyhUKWvUA6GvQY9+AgPTOCACzzYIAWzAI6NEQiOG8IOjgAdwQYdzhYhCIAGjhgADdgKQR0eM9qRQZguCQIeAZgGiRgQswkBnJXOAYIYiQAcnhvFExkOExWGHYkDmtyLpJQzBJq7XgAXiNePpDZnhl5AqVsKdQGWZ0eBrd8PO8-AKDEqMwLQyEQ2Mx4WLxgPxgATzgrYDEikvg-TSmDoCEKAANZuDRuNAUgAU8ZsQYFpkXAFqReGtZAp7EpagjdvtDkA)

This change will unearth a bug regarding the `ESAggregations` interface :)

This is similar to https://github.com/IMA-WorldHealth/bhima/issues/4687.

As opposed to the "expired" status, this status would focus on articles in stock that have articles in stock with an expiration date in the future.  The formula for stock at risk of expiration is if the date the quantity in stock will be consumed is past the expiration date.

Basically, in pseudo-code:
```js
const numMonthsOfStockLeft = (lot.quantity  / lot.CMM);  // how many months of stock left
const today = new Date();

// if we have more months of stock than the expiration date, then we'll need to label these are in risk of expiration
const isInRiskOfExpiration = lot.expiration_date < (today.addMonths(numMonthsOfStockLeft))
```

