The following program `sample.go` triggers an unexpected:

```go
import "reflect"

type I interface {
        Foo() int
}

type T struct {
        Name string
}

func (t T) Foo() int { return 0 }

func f(v reflect.Value) int {
        i := v.Interface().(I)
        return i.Foo()
}

func main() {
        println("hello")
}
```

Expected result:
```console
$ go run ./sample.go
hello
```

Got:
```console
$ yaegi ./sample.go
./sample.go:17:9: undefined field or method: Foo
```
